&lt;p&gt;एक शब्द दिए गये विकल्पों में से केवल संख्याओं के एक समूह द्वारा प्रदर्शित किया जाता है। विकल्पों में दिए गये संख्याओं के समूह, आव्यूहों में दर्शाए गये अक्षरों के दो वर्गों द्वारा प्रदर्शित किए गये हैं। आव्यूह - I के स्तंभ और पंक्तियों को 0 से 4 तक अंकित किया गया है और आव्यूह - II के स्तंभ और पंक्तियों को 5 से 9 तक अंकित किया गया है। इन आव्यूहों में एक अक्षर को पहले उसकी पंक्ति और फिर उसके स्तम्भ से दर्शाया जा सकता है, उदहारण के लिए &amp;lsquo;K&amp;rsquo; को 10, 22 आदि द्वारा दर्शाया जा सकता है और &amp;lsquo; Z&amp;rsquo; को 85, 58 आदि द्वारा दर्शाया जा सकता है। उसी प्रकार, आपको शब्द &amp;lsquo;PERK&amp;rsquo; शब्द के लिए समूह को पहचानना है।&lt;/p&gt;

